import React from 'react'
import Item from '../../components/Item/Item';

const ItemList = () => {
  return (
    <div>
        <Item
        
        PictureUrl = "##"
        ItemName = "Kirby"
        ItemDescription = " Cartel de Kirby en Neon de 80cm x 60cm"
        ItemPrice = "$15.000"
        stock = "10"
        initial = "1"
        />

    </div>

  )
}

export default ItemList;
